#include <torch/torch.h>
#include <vector>
#include <pybind11/pybind11.h>

// Make sure to replace 'aot_inductor_func' with the actual function name generated by the AOT Inductor
extern std::vector<at::Tensor> inductor_entry_cpp(const std::vector<at::Tensor>& args);

class InductorModule {
public:
    std::vector<at::Tensor> forward(const std::vector<at::Tensor>& inputs) {
      std::vector<at::Tensor> outputs = inductor_entry_cpp(inputs);
      return outputs;
}

};


namespace py = pybind11;

PYBIND11_MODULE(inductor_module, m) {
    py::class_<InductorModule>(m, "InductorModule")
        .def(py::init<>())
        .def("forward", &InductorModule::forward);
}
